import { useState, useEffect } from 'react';
import { Navbar, setUserSectionWidth } from './Navbar';
import './App.css'

// puzzle -> blocks -> cells

class Cell {
	constructor() {
		this.value = null
		this.notes = []
		this.mod = null; // false or true
	}
	fill(_value) {
		this.value = _value
	}
	addNotes(number) {
		this.notes.push(number)
	}
	rmNotes() {
		this.notes = []
	}
}

class Game {
	constructor(difficulty) {
		this.difficulty = difficulty;
	}
	updateArrayPuzzle() {

	}
}

class AbstractBoard {
	constructor() {
		this.ctx = null;
		this.cellLength = null;
		this.ctx = this.makeCanvas()
		this.staticPuzzle = this.getStaticPuzzle();
	}
	makeCanvas() {
		let startX;
		let startY;
		let length;

		let windowHeight = window.innerHeight
		let windowWidth = window.innerWidth
		let nav_menu = document.getElementById('nav-menu')
		let nav_rects = nav_menu.getBoundingClientRect()
		let canvas = document.createElement('canvas')

		if (windowHeight >= windowWidth)
			length = nav_rects.width * 0.8
		else
			length = (windowHeight - nav_rects.height) * 0.8
		startX = (nav_rects.width - length) / 2
		startY = nav_rects.height + (windowHeight - (nav_rects.height + length)) / 2
		canvas.width = length
		canvas.height = length
		canvas.style.position = 'absolute'
		canvas.style.left = `${startX}px`
		canvas.style.top = `${startY}px`
		canvas.style.display = 'block'
		this.canvas = canvas
		let ctx = canvas.getContext('2d')
		return ctx
	}
	makePuzzleStructure() {
		let ret = []
		for (let i = 1; i <= 9; i++) {
			let row = []
			for (let j = 1; j <= 9; j++) {
				row.push(new Cell())
			}
			ret.push(row)
		}
		return ret;
	}
	fillPuzzle(sudokuGrid, puzzle) {
		for (let y = 0; y < 9; y++) {
			for (let x = 0; x < 9; x++) {
				puzzle[y][x].fill(sudokuGrid[y][x])
			}
		}
	}
	getStaticPuzzle() {
		const sudokuGrid = [
			[5, 3, 4, 6, 7, 8, 9, 1, 2],
			[6, 7, 2, 1, 9, 5, 3, 4, 8],
			[1, 9, 8, 3, 4, 2, 5, 6, 7],
			[8, 5, 9, 7, 6, 1, 4, 2, 3],
			[4, 2, 6, 8, 5, 3, 7, 9, 1],
			[7, 1, 3, 9, 2, 4, 8, 5, 6],
			[9, 6, 1, 5, 3, 7, 2, 8, 4],
			[2, 8, 7, 4, 1, 9, 6, 3, 5],
			[3, 4, 5, 2, 8, 6, 1, 7, 9]
		];
		let puzzle = this.makePuzzleStructure()
		this.fillPuzzle(sudokuGrid, puzzle)
		return puzzle;
	}
	/**
	 * @param {Cell[][]} puzzle - 2D array of Cell objects
	 */
	drawPuzzle(puzzle) {
		// Clear canvas and set background
		this.ctx.fillStyle = 'white'; // Background to contrast with red
		this.ctx.fillRect(0, 0, this.canvas.width, this.canvas.height);

		// Draw 9x9 grid
		this.ctx.lineWidth = 5;
		this.ctx.strokeStyle = 'red';

		for (let y = 0; y < 9; y++) {
			for (let x = 0; x < 9; x++) {
				// Calculate cell position
				let cellX = x * this.cellLength;
				let cellY = y * this.cellLength;

				// Draw cell
				this.ctx.beginPath();
				this.ctx.rect(cellX, cellY, this.cellLength, this.cellLength);
				this.ctx.stroke();
			}
		}
	}
}

class Board extends AbstractBoard {
	constructor() {
		super()
	}
	drawStaticPuzzle() {
		this.drawPuzzle(this.staticPuzzle)
	}
}

const HandleBoard = () => {
	const [active, setActive] = useState(false)

	useEffect(() => {
		let board = new Board();
		if (!active) {
			console.log("drawing static puzzle")
			board.drawStaticPuzzle()
		}
		// else
		// 	board.drawDynamicPuzzle()
	}, [])

	return (
		<div id="Board-container">
		</div>
	)
}

const App = () => {
	return (
		<>
			<Navbar />
			<HandleBoard />
		</>
	)
}

export default App;
